    [],nt"num_tags": 0,nt"name": "dissolved-inorganic-carbon-ph-alkalinity-temperature-salinity-and-other-variables-collected-fro8dd33",nt"isopen":
    false,nt"url": null,nt"notes": "NODC Accession 0112346 includes biological,
    chemical, discrete sample, physical and profile data collected from HAKUREI MARU
    in the North Pacific Ocean from 2001-08-13 to 2001-10-22 and retrieved during cruise
    49HG20010813 and NH01. These data include ALKALINITY, CHLOROFLUOROCARBON-11 (CFC-11),
    CHLOROFLUOROCARBON-113 (CFC-113), CHLOROFLUOROCARBON-12 (CFC-12), CHLOROPHYLL A,
    DISSOLVED INORGANIC CARBON, DISSOLVED ORGANIC CARBON, DISSOLVED OXYGEN, HYDROSTATIC
    PRESSURE, NITRATE + NITRITE CONTENT (CONCENTRATION), NITRITE, PHOSPHATE, SALINITY,
    SILICATE, SULFUR HEXAFLUORIDE (SF6), WATER TEMPERATURE and pH. The instruments used
    to collect these data include CTD, Coulometer for DIC measurement and bottle. These
    data were collected by Fumiyasu Nishibori of General Environmental Technos Co LTD
    and Yutaka W. Watanabe of National Institute for Resources and Environment as part
    of the PACIFICA_49HG20010813 data set.nnPACIFICA (PACIFic ocean Interior CArbon)
    was an international collaborative project for the data synthesis of ocean interior
    carbon and its related parameters in the Pacific Ocean. The North Pacific Marine
    Science Organization (PICES), Section of Carbon and Climate (S-CC) supported the
    project.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
